export const initialState = {
    category: null,
    filter: null,
  };

  // Selector
  export const generate = (category) => 
   category?.reduce((amount, item) => item.price + amount, 0);

  const reducer = (state, action) => {
    console.log(action);

    return state;
  };

  export default reducer;
